import React, { useEffect, useState } from "react";
import { useLocalState } from '../util/UseLocalStorage';
import {Card, Button } from 'react-bootstrap';
import { Link, Navigate } from "react-router-dom";
import ajax from "../services/fetchService";

const Dashboard = () => {
    const[jwt, setJwt] = useLocalState("", "jwt");
    const[assignments, setAssignments] = useState(null);

    useEffect(() => {
        ajax("api/v1/assignments", "GET", jwt).then(
            assignmentsData => {
                setAssignments(assignmentsData);
            }
        );
    }, []);

    function createAssignment() {
        ajax("/api/v1/assignments", "POST", jwt).then(
            (assignment) =>{
                window.location.href = `/assignments/${assignment.id}`;
            }
        );
    }

    return (
        <div style={{ margin: "2em" }}>
            {assignments ? ( 
                assignments.map((assignment) => (
                    <div key={assignment.id}>
                            <Card style={{ width: '18rem' }}>
                            <Card.Body>
                                <Card.Title>Assignment {assignment.id}</Card.Title>
                                <Card.Subtitle className="mb-2 text-muted">{assignment.status}</Card.Subtitle>
                                <Card.Text style={{marginTop: "1em"}}>
                                    <p><b>GitHub Url</b> : {assignment.githubUrl}</p>
                                    <p><b>Branch</b> : {assignment.branch}</p>
                                </Card.Text>
                                <Navigate to={``}>
                                    <Button>Edit</Button>
                                </Navigate>
                                <Card.Link href="#">Another Link</Card.Link>
                            </Card.Body>
                            </Card>
                    </div>
                )) 
            ) : (
                <></>
            )}
            <button onClick={() => createAssignment()}>Submit New Assignment</button>
        </div>
    );
};

export default Dashboard;
